import os.path as osp
import base64
import os

def get_pics():
    pics = {"cancel_png": "", "close_png": "", "color-line_png": "", "color_png": "", "copy_png": "", "delete_png": "", "done_png": "", "edit_png": "", "expert_png": "", "eye_png": "", "feBlend-icon_png": "", "file_png": "", "fit-width_png": "", "fit-window_png": "", "fit_png": "", "help_png": "", "icon_png": "", "labels_png": "", "new_png": "", "objects_png": "", "open_png": "", "prev_png": "", "quit_png": "", "save-as_png": "", "save_png": "", "undo-cross_png": "", "undo_png": "", "zoom-in_png": "", "zoom-out_png": "", "zoom_png": "", "next_png": ""}


    for key in pics:
        img_name = osp.join('icons',key.replace('_', '.'))
        img = pics[key]
        #if not osp.exists(img_name):
        #    os.mknod(img_name)
        tmp = open(img_name, 'wb')        #创建临时的文件
        tmp.write(base64.b64decode(img))    ##把这个one图片解码出来，写入文件中去。
        tmp.close()
    return pics



if __name__ == "__main__":
    a = get_pics()
    print(a)

